DROP TABLE IF EXISTS `ol_bank_trade`;
CREATE TABLE `ol_bank_trade` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bk_id` int(11) NOT NULL DEFAULT '0' COMMENT '银行id',
  `pd_id` int(11) NOT NULL DEFAULT '0' COMMENT '产品id',
  `pd_info` varchar(100) NOT NULL DEFAULT '' COMMENT '银行产品信息',
  `td_tp` varchar(10) NOT NULL DEFAULT '' COMMENT '交易类型:1-买入；2-收益；9-赎回；',
  `order_amt` double NOT NULL DEFAULT '0' COMMENT '订单金额',
  `status` varchar(10) DEFAULT NULL COMMENT '交易状态：1-买入(持有中)；9-赎回完成',
  `trade_time` timestamp NULL DEFAULT NULL COMMENT '交易时间',
  `order_amt_buy` double DEFAULT NULL COMMENT '订单买入金额',
  `order_amt_redem` double DEFAULT NULL COMMENT '回款金额',
  `order_amt_earn` double DEFAULT NULL COMMENT '收益金额',
  `code` varchar(50) DEFAULT NULL COMMENT '交易code',
  `order_code_buy` varchar(100) DEFAULT NULL COMMENT '订单号(买入)',
  `order_code_redem` varchar(100) DEFAULT NULL COMMENT '订单号(赎回)',
  `order_code_earn` varchar(100) DEFAULT NULL COMMENT '订单号(收益)',
  `order_time_buy` datetime DEFAULT NULL COMMENT '购买时间',
  `order_time_redem` datetime DEFAULT NULL COMMENT '赎回时间',
  `position_status` varchar(10) DEFAULT NULL COMMENT '持仓状态：1-持有中；0已赎回；',
  `position_amt` double DEFAULT NULL COMMENT '持仓金额',
  `position_days` int(11) DEFAULT NULL COMMENT '持有天数',
  `remark` varchar(200) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_codebuy` (`order_code_buy`) USING BTREE COMMENT '购买订单编号索引'
) ENGINE=InnoDB AUTO_INCREMENT=1017 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='银行交易记录';

