  `CONFIRM_AMT` double DEFAULT NULL COMMENT '确认金额(购买)',
  `REDEM_AMT` double DEFAULT NULL COMMENT '赎回金额',
  `EARN_AMT` double DEFAULT NULL COMMENT '收益金额',
